import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for at least one "Add to Cart" button (by text, fallback to class)
    let addToCartButtons = await page.$$('button:has-text("Add to Cart")');
    if (addToCartButtons.length === 0) {
      await page.waitForSelector('.add-to-cart', { timeout: 5000 });
      addToCartButtons = await page.$$('.add-to-cart');
    }

    // Rapidly click the first three "Add to Cart" buttons (simulate stress)
    for (let i = 0; i < Math.min(3, addToCartButtons.length); i++) {
      await addToCartButtons[i].click();
      // Small delay to simulate rapid user (not too fast for DOM)
      await page.waitForTimeout(150);
    }

    // Take screenshot after rapid adds
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_after_adds.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_after_adds.png'));

    // Open cart: try clicking the cart div by text content
    let cartSelector = '//div[contains(normalize-space(.), "Cart")]';
    await page.waitForSelector(cartSelector, { timeout: 5000 });
    const cartDiv = await page.$(cartSelector);
    await cartDiv.click();

    // Wait for cart modal or cart items to appear (look for "cart-item" class or "empty-cart" as fallback)
    let cartItemSelector = '.cart-item';
    let emptyCartSelector = '.empty-cart';
    await page.waitForSelector(`${cartItemSelector}, ${emptyCartSelector}`, { timeout: 5000 });

    // Take screenshot of cart modal
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_cart_opened.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_cart_opened.png'));

    // If there are cart items, rapidly increment and decrement quantity of first item
    const cartItems = await page.$$(cartItemSelector);
    let cartItemTitle = '';
    let quantityAfter = null;
    if (cartItems.length > 0) {
      // Get the title of the first cart item for verification
      const titleEl = await cartItems[0].$('div.cart-item-title');
      if (titleEl) {
        cartItemTitle = (await titleEl.textContent()).trim();
      }
      // Find the "+" and "-" buttons inside the first cart item
      const plusBtn = await cartItems[0].$('button:has-text("+")');
      const minusBtn = await cartItems[0].$('button:has-text("-")');
      // Rapidly click "+" three times
      for (let i = 0; i < 3; i++) {
        if (plusBtn) await plusBtn.click();
        await page.waitForTimeout(100);
      }
      // Rapidly click "-" two times
      for (let i = 0; i < 2; i++) {
        if (minusBtn) await minusBtn.click();
        await page.waitForTimeout(100);
      }
      // Take screenshot after quantity changes
      await page.screenshot({ path: path.join(screenshotsDir, 'step_4_quantity_changed.png') });
      screenshots.push(path.join(screenshotsDir, 'step_4_quantity_changed.png'));
      // Extract new quantity
      const qtySpan = await cartItems[0].$('span.quantity');
      if (qtySpan) {
        quantityAfter = (await qtySpan.textContent()).trim();
      }
    }

    // Remove first item if present
    if (cartItems.length > 0) {
      const removeBtn = await cartItems[0].$('button.remove-item');
      if (removeBtn) {
        await removeBtn.click();
        await page.waitForTimeout(300);
        await page.screenshot({ path: path.join(screenshotsDir, 'step_5_item_removed.png') });
        screenshots.push(path.join(screenshotsDir, 'step_5_item_removed.png'));
      }
    }

    // Extract cart total if available
    let cartTotal = null;
    const cartTotalEl = await page.$('#cartTotal');
    if (cartTotalEl) {
      cartTotal = (await cartTotalEl.textContent()).trim();
    }

    // Return result
    return {
      success: true,
      action: "Performed rapid add/remove/quantity changes in cart and verified cart state",
      extractedData: {
        firstCartItemTitle: cartItemTitle,
        quantityAfter,
        cartTotal
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
